Я - многопрофильный профессиональный фотограф, преподаватель, эксперт в области фотографии. 
Опыт съемки более 10 лет.
Топ 10 свадебных фотографов Казани.
Основатель фотостудии "Зебра", "Синий Арбуз".
Официальный фотограф и эксперт свадебного журнала "Всё о свадьбе-Ivory".
Фотограф ХК "АК БАРС" 2007-2010гг.
Неоднократный призёр свадебных конкурсов Республики Татарстан. Победитель конкурса фотографов в МК Ильи Двояковского по цветокоррекции
Член оргкомитета Казанского форума фотографов и видеографов.
Мною сфотографированы более двух сотен семей и более пятьсот свадеб.

Мне доверяют:
- Помощник Президента РТ Наталья Фишман;
- Гостинично-развлекательный комплекс "Казанская Ривьера";
- Всероссийский фестиваль "Бриллиантовая Невеста";
- Республиканский конкурс женской красоты, материнства и семьи "Нечкэбил";
- Театр оперы и балета им.Мусы Джалиля;
- Отели "Рамада", "Корстон", "Мираж", "Luciano" "Ривьера", "Шаляпин", "Биляр-палас", "Гранд Отель-Казань";
- Свадебное агенство "Dream Wedding";
- Свадебное Агенство"Простые Радости";
- Свадебное Агенство"Dolce Vita";
- Свадебное Агенство "Адмирал Wedding";
- Свадебное Агенство Елены Ягудиной.

Провожу авторские курсы для начинающих и опытных фотографов http://vk.com/fotokurskazan
